const { Language } = require("@material-ui/icons")


const LanguageChanger = ()=>{
    return(
        <div style={{display:'flex',flexDirection:'row'}}>
            <Typography color={'inherit'}>
                Lanugages
            </Typography>
            <IconButton size={'medium'} color={'inherit'}>
                <Language/>
            </IconButton>
        </div>
    )
}

export default LanguageChanger
